import React from "react";

const MonthComponent = (props) => {
    const {setMonths, setNow,setYear, now, month, months, year} = props


    return (
        <>
            <p>
                <button onClick={ () => {
                    setNow(now.subtract(1,'month'))
                    setYear(now.year())
                    setMonths(now.month())
                }}>
                    Prev
                </button>
                    {month[months] +year} 
                <button onClick={ () => {
                    setNow(now.add(1,'month'))
                    setYear(now.year())
                    setMonths(now.month())
                }}>
                    Next
                </button> 
            </p>
        </>
    ) 
}

export default MonthComponent
